import React, { Component } from "react";
import AddPageComponent from "./AddPageComponent";
import { push } from "connected-react-router";
import { func, number, string } from "prop-types";
import { connect } from "react-redux";

const propTypes = {
  push: func,
  SaveClick: func,
  AddItem: func,
  CloseClick: func,
  handleChangeName: func,
  handleChangeValue: func,
  name: string,
  value: string,
};

class AddPAgeContainer extends Component {
  maxId = 100;

  constructor(props) {
    super(props);
    this.state = {
      name: '',
      value: '',
  };

    // this.AddItem = this.AddItem.bind(this);
    this.CloseClick = this.CloseClick.bind(this);
    this.SaveClick = this.SaveClick.bind(this);
    this.handleChangeName = this.handleChangeName.bind(this);
    this.handleChangeValue = this.handleChangeValue.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  CloseClick = () => {
    console.log("piska Close");
  };

  SaveClick = () => {
    console.log("piska Save");
  };

  handleChangeName = event => {
    this.setState({ name: event.target.name });
  };

  handleChangeValue = event => {
    this.setState({ value: event.target.value });
  };

  handleSubmit = event => {
    console.log("було надіслано: " + this.state.value);
    console.log("було надіслано: " + this.state.name);
    event.preventDefault();
  };

  render() {
    return (
        <AddPageComponent
          onClickHandler={this.onClickHandler}
          SaveClick={this.SaveClick}
          CloseClick={this.CloseClick}
          handleChangeList={this.handleChangeList}
          handleChangeGrn={this.handleChangeGrn}
          handleSubmit={this.handleSubmit}
          name = {this.state.name}
          value = {this.state.value}
        />
    );
  }
}

// const mapStateToProps = propTypes => {
//   return{

//   }
// };

const mapDispatchToProps = {
  push
};

AddPageComponent.propTypes = propTypes;

export default connect(null, mapDispatchToProps)(AddPAgeContainer);
